Input = ["""



"""]

# Input = ["""ULL
# RRDDD
# LURDL
# UUUUD"""]

Input = Input[0].split("\n")

Position = 5
Password = ""

for Button in Input:
  for Index in range(len(Button)):
    CurrentInstruction = Button[Index]
    if CurrentInstruction == "D":
      if Position in [1, 2, 3, 4, 6, 7, 8, "B"]:
        Index = [1, 2, 3, 4, 6, 7, 8, "B"].index(Position)
        Position = [3, 6, 7, 8, "A", "B", "C", "D"][Index]
    if CurrentInstruction == "U":
      if Position in [3, 6, 7, 8, "A", "B", "C", "D"]:
        Index = [3, 6, 7, 8, "A", "B", "C", "D"].index(Position)
        Position = [1, 2, 3, 4, 6, 7, 8, "B"][Index]
    if CurrentInstruction == "L":
      if Position in [3, 4, 6, 7, 8, 9, "B", "C"]:
        Index = [3, 4, 6, 7, 8, 9, "B", "C"].index(Position)
        Position = [2, 3, 5, 6, 7, 8, "A", "B"][Index]
    if CurrentInstruction == "R":
      if Position in [2, 3, 5, 6, 7, 8, "A", "B"]:
        Index = [2, 3, 5, 6, 7, 8, "A", "B"].index(Position)
        Position = [3, 4, 6, 7, 8, 9, "B", "C"][Index]
  Password = Password + str(Position)
print(Password)
